import React from 'react'
import styles from './form.module.css'


class Page extends React.Component {
    render() {
        return (
            <div className={styles.form}>
                <form>
               <input className={styles.input} type="text" placeholder="title"></input>
               <br></br>
               <input className={styles.input} type="email" placeholder="email"></input>
               <textarea className={styles.textarea} id="noter-text-area" name="textarea" placeholder="tipe"></textarea>
               <button>Submit</button>
           </form>
            </div>

        )

    }

}

export default Page
